(9, 'Product Manager/ Product Owner', 'product-manager-product-owner', 9, 9, '2025-01-12', '<h3>M&ocirc; t·∫£ c&ocirc;ng vi·ªác</h3>\r\n\r\n<ul>\r\n	<li>Lead the planning to develop features that help to promote growth in the platform&#39;s total disbursement value.</li>\r\n	<li>Research and analyze the market, competitors and global product trends to identify &amp; apply new ideas to bring value to customers</li>\r\n	<li>Work directly with customers to understand their painpoints to develop platform features to make it easier for customers to get access to official funding</li>\r\n	<li>Own the partnership with bank partners, from contract negotiation to onboarding &amp; go-to-market strategy execution</li>\r\n	<li>Manage, prioritize, and classify customer and partner requests to build &amp; oversee the product development roadmap.</li>\r\n	<li>Create business plans and implement marketing activities to ensure business goals are met.</li>\r\n	<li>Engage with Marketing-Sales department to build growth strategies and Go-to-market plan</li>\r\n</ul>\r\n\r\n<h3>Y&ecirc;u c·∫ßu ·ª©ng vi&ecirc;n</h3>\r\n\r\n<p><strong>Required:</strong></p>\r\n\r\n<ul>\r\n	<li>Bachelor&#39;s degree in Banking or Finance from a reputable university such as Foreign Trade University, National Economics University, Banking Academy, or Finance Academy ...</li>\r\n	<li>At least 1 year of experience as PO/PM, prefer in a credit or digital banking department at a top-bank</li>\r\n	<li>Excellent communication and teamwork skills, strong persuasion, negotiation, and problem-solving abilities.</li>\r\n	<li>Ability to research, synthesize, analyze, and evaluate the market and customers to identify directions and make product development plans.</li>\r\n	<li>Ability to plan and manage work and time effectively.</li>\r\n</ul>\r\n\r\n<p><strong>Preferred:</strong></p>\r\n\r\n<ul>\r\n	<li>Master&#39;s degree in Business Administration (MBA), preferably from a prestigious university in the UK, US, Australia, or other Western countries.</li>\r\n	<li>International certifications in Product Management and UX Design.</li>\r\n	<li>Working experience in fintech environment.</li>\r\n	<li>Knowledge of Design Thinking and Customer Centric.</li>\r\n	<li>Basic knowledge of software design (UI, UX).</li>\r\n</ul>\r\n\r\n<h3>Quy·ªÅn l·ª£i</h3>\r\n\r\n<p><strong>Dedicated Employee Care:</strong></p>\r\n\r\n<ul>\r\n	<li>Agreement for salary (Based on your ability and experience, we never offer less than you deserve)</li>\r\n	<li>Salary&rsquo;s review twice a year</li>\r\n	<li><strong>Year-end bonus based on performance, from 2 months&#39; salary</strong></li>\r\n	<li>Free lunch provided at the company</li>\r\n	<li>Working hours: 8am - 5:30pm (Monday - Friday)</li>\r\n	<li>Birthday gifts, sick leave, maternity leave, vacation, teambuilding, and full health check-ups</li>\r\n	<li>Cultural and sports clubs and many regular cultural and recreational programs</li>\r\n	<li>Modern, spacious working environment with many entertainment facilities: bar, mini golf course, climbing area...</li>\r\n	<li>Cool and airy office surroundings, convenient for transportation</li>\r\n</ul>\r\n\r\n<p><strong>Open, professional environment that promotes creativity:</strong></p>\r\n\r\n<ul>\r\n	<li>Working for a company with a mission to serve society, providing products and services to change productivity for organizations and individuals</li>\r\n	<li>Culture of open communication and enthusiastic support; young, understanding leaders and friendly colleagues</li>\r\n	<li>Structured working process, clear product vision</li>\r\n	<li>Encourages initiative and active learning</li>\r\n</ul>\r\n\r\n<p><strong>Focus on supporting personal development:</strong></p>\r\n\r\n<ul>\r\n	<li>Career development path for each position and individual, towards management or specialist roles</li>\r\n	<li>Participation in professional and soft skills training courses at different stages</li>\r\n	<li>Participation in professi